      },
      rules: {
        username: [{
          required: true,
          message: '请输入用户名',
          trigger: 'blur'
        }],
        password: [{
          required: true,
          message: '请输入密码',
          trigger: 'blur'
        }]
      }
    };
  },
  methods: {
    submitForm: function submitForm(formName) {
      var _this = this;

      var params = {
        'geNumber': this.ruleForm.username,
        'password': this.ruleForm.password
      };
      this.$refs[formName].validate(function (valid) {
        if (valid) {
          // localStorage.setItem('ms_username',this.ruleForm.username);
          API.common.login(params).then(function (_ref) {
            var data = _ref.data;
            console.log(data.data);

            if (data.status == 0) {
              if (data.msg == 'success') {
                //设置半个小时过期
                _this.$cookie.set('role', data.role);

                _this.$cookie.set('username', data.data.principal);

                _this.$router.push('/dashboard');
              } else {
                _this.$message(data.msg);
              }
            } else {
              //this.$Message.error(data.msg);
              _this.$message("请求失败！");
            }
          }).catch(function (data) {
            _this.$message("请求失败ww！");

            console.log(data);
          });
        } else {
          console.log('error submit!!');
          return false;
        }
      });
    }
  }
